--  DDL for Package Body PKG_CALCULOS
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE PACKAGE BODY "LIBROCV02"."PKG_CALCULOS" as

  function isr(pvalor number) return number as
    ISR Number(12,4);
  begin
    ISR := pkg_lov.ISR(); 
    return pvalor*ISR;
  Exception
        When OTHERS Then
             raise_application_error(
                                   -20001,
                                   'An error was encountered con el ISR - '
                                   ||to_char(pvalor)
                                   ||',  '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm);  
  end isr;

  function iva(pvalor number) return number as
    IVA Number(12,4);
  begin
    IVA := pkg_lov.IVA(); 
    return pvalor*IVA;
  Exception
        When OTHERS Then
             raise_application_error(
                                   -20001,
                                   'An error was encountered con IVA - '
                                   ||to_char(pvalor)
                                   ||',  '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm);    
    
  end iva;
  
  function sin_iva(pvalor number) return number as
    IVA Number(12,5);
  begin
    IVA := pkg_lov.IVA();
    return pvalor / (1+IVA);
  Exception
        When OTHERS Then
             raise_application_error(
                                   -20001,
                                   'An error was encountered sin_iva - '
                                   ||to_char(pvalor)
                                   ||',  '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm);    
  end sin_iva;

  function ISR_Sin_IVA(pvalor number) return number as
    IVA Number(12,5);
    ISR Number(12,4);
    monto_sin_iva Number(12,5);
  begin
    IVA := pkg_lov.IVA();
    ISR := pkg_lov.ISR(); 
    monto_sin_iva := pvalor / (1+IVA);
    return monto_sin_iva*ISR;
  Exception
        When OTHERS Then
             raise_application_error(
                                   -20001,
                                   'An error was encountered ISR_Sin_IVA - '
                                   ||to_char(pvalor)
                                   ||',  '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm);    
  end ISR_Sin_IVA;
  
  function IVA_Incluido(pvalor number) return number as
    IVA Number(12,5);
    iva_sin_monto Number(12,5);
  begin
    IVA := pkg_lov.IVA();
    iva_sin_monto := pvalor - (pvalor / (1+IVA));
    return iva_sin_monto;
  Exception
        When OTHERS Then
             raise_application_error(
                                   -20001,
                                   'An error was encountered ISR_Sin_IVA - '
                                   ||to_char(pvalor)
                                   ||',  '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm);    
  end IVA_Incluido;
end pkg_calculos;

