--  DDL for Package Body PKG_FACTURAS_SAT
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE PACKAGE BODY "LIBROCV02"."PKG_FACTURAS_SAT" AS

    PROCEDURE Insert_facturas (
        ptiporecepcion IN VARCHAR2
    ) IS
    
    CURSOR c1_factura IS
    SELECT
        
        pkg_fechas.todate(fecha_emision) as fecha_Emision,
        pkg_fechas.toTimeStamp(fecha_emision) as fecha_Emision_TS,
        no_autorizacion,
        tipo_dte,
        serie,
        no_dte,
        nit_emisor,
        nombre_emisor,
        codigo_establecimiento,
        nombre_establecimiento,
        id_receptor,
        nombre_receptor,
        nit_certificador,
        nombre_certificador,
        moneda,
        monto,
        estado,
        marca_anulado,
        fecha_anulacion,
        monto_iva,
        monto_petroleo,
        monto_turismo_hospedaje,
        monto_turismo_pasaje,
        monto_timbre_prensa,
        monto_bombero,
        monto_tasa_municipal,
        monto_alcoholicas,
        monto_tabaco,
        monto_cemento,
        monto_no_alcoholicas,
        monto_tarifas_portuaria
    FROM
        tmp_carga_facturas;
        
     TipoOrigen_exception EXCEPTION;
BEGIN
    
    If ptiporecepcion is null Then 
       Raise TipoOrigen_exception;
    End if;
    
    FOR c1 IN c1_factura LOOP
            tipo_origen,
            anio,
            mes,
            fecha_emision,
            fecha_emision_ts,
            no_autorizacion,
            tipo_dte,
            serie,
            no_dte,
            nit_emisor,
            nombre_emisor,
            codigo_establecimiento,
            nombre_establecimiento,
            id_receptor,
            nombre_receptor,
            nit_certificador,
            nombre_certificador,
            moneda,
            monto,
            estado,
            marca_anulado,
            fecha_anulacion,
            monto_iva,
            monto_petroleo,
            monto_turismo_hospedaje,
            monto_turismo_pasaje,
            monto_timbre_prensa,
            monto_bombero,
            monto_tasa_municipal,
            monto_alcoholicas,
            monto_tabaco,
            monto_cemento,
            monto_no_alcoholicas,
            monto_tarifas_portuaria,
            aplica
        ) VALUES (
            ptiporecepcion,
            pkg_fechas.toyear(c1.Fecha_Emision),
            pkg_fechas.tomonth(c1.Fecha_Emision_ts),
            c1.fecha_emision,
            c1.Fecha_Emision_ts,
            c1.no_autorizacion,
            c1.tipo_dte,
            c1.serie,
            c1.no_dte,
            c1.nit_emisor,
            c1.nombre_emisor,
            c1.codigo_establecimiento,
            c1.nombre_establecimiento,
            c1.id_receptor,
            c1.nombre_receptor,
            c1.nit_certificador,
            c1.nombre_certificador,
            c1.moneda,
            to_number(c1.monto),
            c1.estado,
            c1.marca_anulado,
            pkg_fechas.todate(c1.fecha_anulacion),
            to_number(c1.monto_iva),
            to_number(c1.monto_petroleo),
            to_number(c1.monto_turismo_hospedaje),
            to_number(c1.monto_turismo_pasaje),
            to_number(c1.monto_timbre_prensa),
            to_number(c1.monto_bombero),
            to_number(c1.monto_tasa_municipal),
            to_number(c1.monto_alcoholicas),
            to_number(c1.monto_tabaco),
            to_number(c1.monto_cemento),
            to_number(c1.monto_no_alcoholicas),
            to_number(c1.monto_tarifas_portuaria),
            0
        );

    END LOOP;
 
    

    COMMIT;
    
EXCEPTION
    WHEN TipoOrigen_exception Then
        raise_application_error(
                               -20001,
                               'Tipo Oriden debe ser (E)mitido o (R)ecibido, pero no vacio'
                               || sqlcode
                               || ' -ERROR- '
                               || sqlerrm
        );
    WHEN OTHERS THEN
        raise_application_error(
                               -20001,
                               'An error was encountered - '
                               || sqlcode
                               || ' -ERROR- '
                               || sqlerrm
        );
End Insert_facturas;

Procedure Delete_facturas (ptiporecepcion in Varchar2) 
Is
    Fecha1 Date;
    Fecha2 Date;
    TipoOrigen_exception EXCEPTION;
Begin

    If ptiporecepcion is null Then 
       Raise TipoOrigen_exception;
    End if;

    Select Min(pkg_fechas.todate(fecha_emision)),
           Max(pkg_fechas.todate(fecha_emision))
    into Fecha1,Fecha2
    From tmp_carga_facturas;
    
    Dbms_output.put_line ('Parametros: '||ptiporecepcion||'-'||to_char(Fecha1,'yyyy-mm-dd')||'-'||to_char(Fecha2,'yyyy-mm-dd'));
    
    Delete From carga_facturas_sat
    where tipo_origen=ptiporecepcion
    and Fecha_Emision Between Fecha1 and Fecha2;
    
    
    
EXCEPTION
    WHEN TipoOrigen_exception Then
        raise_application_error(
                               -20001,
                               'Tipo Oriden debe ser (E)mitido o (R)ecibido, pero vacio'
                               || sqlcode
                               || ' -ERROR- '
                               || sqlerrm
        );
End Delete_facturas;
        
PROCEDURE Delete_Tmp_Facturas is
Begin
    -- Limpia la tabla temporal
    Delete from tmp_carga_facturas;
End Delete_Tmp_Facturas;

Procedure Crear_Libro (pNit in Varchar2, pAnio In Number, pMes In Number, pTipoOrigen  In Number) is

 Parametros_Exception EXCEPTION;
 --lNit Varchar2(200);
 
Begin
      If pNit is null or pTipoOrigen is null Or pAnio is null OR pMes is null Then 
         Raise Parametros_Exception;
      End if;
      
      -- Recupera el Nit del proveedor
      --Select  Pkg_lov.LovProveedorNit(pidproveedor) Into lNit
      --From dual;
      
      
     Crear_Libro_Encabezado(pNit,pAnio, pMes, pTipoOrigen);
     Crear_Libro_Detalle(pNit,pAnio, pMes, pTipoOrigen);
     
Exception 
          
             
          WHEN Parametros_Exception THEN
                raise_application_error(
                                       -20001,
                                       'Los parametros Id Proveedor, Anio, Mes o TipoOrigen debe ser valores validos '
                                       || sqlcode
                                       || ' -Parametros_Exception- '
                                       || sqlerrm
                );
                
          
          WHEN OTHERS THEN
             raise_application_error(
                                   -20001,
                                   'An error was encountered - '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm
             );
                  
End Crear_Libro;

Function fExisteLibro (pnit in varchar2, pAnio In Number, pMes In Number) return number as
 result Number;
    Existe_Libro Number(1) := 0;
Begin
    
    Select 1 Into Existe_Libro
    From Libroe
    Where nit = pkg_lov.lovproveedorId(pnit)
    and anio=panio
    and mes=pmes;
    Return 1;
Exception 
    When Others Then
       Return 0;
End fExisteLibro;

Procedure Crear_Libro_Encabezado (pnit in varchar2, pAnio In Number, pMes In Number, pTipoOrigen  In Number) is
CURSOR c1_Encabezado IS
    SELECT
        anio,
        mes,
        tipo_origen,
        sum(monto) monto,
        Sum(monto_iva) monto_iva,
        sum(monto_petroleo) monto_petroleo,
        sum(monto_turismo_hospedaje+
            monto_turismo_pasaje+
            monto_timbre_prensa+
            monto_bombero+
            monto_tasa_municipal+
            monto_alcoholicas+
            monto_tabaco+
            monto_cemento+
            monto_no_alcoholicas+
            monto_tarifas_portuaria) Monto_otros
        FROM
            carga_facturas_sat
        Where Upper(estado)='VIGENTE'
        and anio=panio
        and mes=pmes
        and Tipo_Origen=pTipoOrigen
        and (Id_Receptor=pNit or Nit_Emisor = pNit)
     Group by anio,mes,tipo_origen;
     
      Parametros_Exception EXCEPTION;
      Existe_Libro Number(1) := 0;
      
Begin
    If pnit is null or pTipoOrigen is null Or pAnio is null OR pMes is null Then 
       Raise Parametros_Exception;
    End if;
    
   
    Existe_Libro := fExisteLibro(pnit,panio, pmes);
    
    if Existe_Libro = 0 Then
    
        FOR c1 IN c1_Encabezado LOOP
                fecha_generado,
                anio,
                mes,
                nit,
                total_bruto,
                iva,
                total_sin_iva,
                total_isr,
                estado
            ) VALUES (
                Sysdate,
                c1.anio,
                c1.mes,
                pkg_lov.lovproveedorId(pnit),
                c1.monto,
                c1.monto_iva,
                0,
                0,
                pkg_lov.lovestadolibro('1')
            );
        
        End Loop;
     End if;   
        
Exception 
          
             
          WHEN Parametros_Exception THEN
                raise_application_error(
                                       -20001,
                                       'Los parametros Nit, Anio, Mes o TipoOrigen debe ser valores validos '
                                       || sqlcode
                                       || ' -Parametros_Exception- '
                                       || sqlerrm
                );
                
          WHEN DUP_VAL_ON_INDEX THEN
                      raise_application_error(
                                       -20001,
                                       'Libro ya esta creado!!, imposible volver a generarlo. '
                                       || sqlcode
                                       || ' -Parametros_Exception- '
                                       || sqlerrm
                );
          WHEN OTHERS THEN
             raise_application_error(
                                   -20001,
                                   'An error was encountered - '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm
             );
             
End Crear_Libro_Encabezado;



Procedure Crear_Libro_Detalle (pnit in varchar2, pAnio In Number, pMes In Number, pTipoOrigen  In Number) is

CURSOR c1_Detalle IS
    SELECT
        id_documento,
        anio,
        mes,
        tipo_origen,
        fecha_emision,
        fecha_emision_ts,
        no_autorizacion,
        tipo_dte,
        serie,
        no_dte,
        nit_emisor,
        moneda,
        monto,
        estado,
        monto_iva,
        monto_petroleo,
        monto_turismo_hospedaje,
        monto_turismo_pasaje,
        monto_timbre_prensa,
        monto_bombero,
        monto_tasa_municipal,
        monto_alcoholicas,
        monto_tabaco,
        monto_cemento,
        monto_no_alcoholicas,
        monto_tarifas_portuaria,
        aplica
    FROM carga_facturas_sat
        Where Upper(estado)='VIGENTE'
        and anio=panio
        and mes=pmes
        and Tipo_Origen=pTipoOrigen
        and (Id_Receptor=pNit or Nit_Emisor = pNit)
   Order by Fecha_emision;        
     
      Parametros_Exception EXCEPTION;
      
      Id_Encabezado Number;
Begin
    If pTipoOrigen is null Or pAnio is null OR pMes is null Then 
       Raise Parametros_Exception;
    End if;
    
    Select id_libroe Into Id_Encabezado
    From LibroE
    Where Anio= panio
    and Mes = pmes
    and Nit = pkg_lov.lovproveedorId(pnit);
    
    
    FOR c1 IN c1_Detalle LOOP
                        id_libroe_fk,
                        fecha_emision,
                        nit_emisor,
                        tipo_documento_fk,
                        serie,
                        numero_dte,
                        monto,
                        monto_iva,
                        monto_petroleo,
                        tipo_gasto_fk,
                        tipo_gasolina_fk,
                        tipo_origen_fk,
                        estado_linea_fk
                    ) VALUES (
                        
                        Id_Encabezado,
                        c1.Fecha_Emision,
                        pkg_lov.lovproveedorId(c1.nit_emisor),
                        pkg_lov.lovtipodoc(c1.tipo_dte),
                        c1.serie,
                        c1.no_dte,
                        c1.monto,
                        c1.monto_iva,
                        c1.monto_petroleo,
                        pkg_lov.LovTipoGasto('VA'),
                        pkg_lov.LovTipoCombustible('X'),
                        pTipoOrigen,
                        pkg_lov.LovEstadoLibroDte('I')
                    );
    
    End Loop;
        
Exception 
          
             
          WHEN Parametros_Exception THEN
                raise_application_error(
                                       -20001,
                                       'Los parametros Anio, Mes o TipoOrigen debe ser valores validos '
                                       || sqlcode
                                       || ' -Parametros_Exception- '
                                       || sqlerrm
                );
           WHEN DUP_VAL_ON_INDEX THEN
                      raise_application_error(
                                       -20001,
                                       'Libro ya esta creado!!, imposible volver a generarlo. '
                                       || sqlcode
                                       || ' -Parametros_Exception- '
                                       || sqlerrm
                );      
          WHEN OTHERS THEN
             raise_application_error(
                                   -20001,
                                   'An error was encountered - '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm
             );
             
End Crear_Libro_Detalle;
        
Procedure Borrar_Libro (IdProveedor in Number,pAnio In Number, pMes In Number ) is        
    IdLibroE Number;
    Parametros_Exception EXCEPTION;
Begin
 
    -- 1. Recupera el IdLibroE
    Select Id_LibroE Into IdLibroE
    From LibroE
    Where Anio= panio
    and Mes = pmes
    and Nit = IdProveedor;
    
    -- 2. Borra todos los regristros con el IdLibroE del detalle
    Delete From LibroD
    Where Id_LibroE_FK = IdLibroE;
    
    -- 3.Borra libro Encabezado
    Delete LibroE
    Where Anio= panio
    and Mes = pmes
    and Nit = IdProveedor;
    
Exception 
          
             
          WHEN Parametros_Exception THEN
                raise_application_error(
                                       -20001,
                                       'Los parametros Anio, Mes o TipoOrigen debe ser valores validos '
                                       || sqlcode
                                       || ' -Parametros_Exception- '
                                       || sqlerrm
                );
          WHEN OTHERS THEN
             raise_application_error(
                                   -20001,
                                   'An error was encountered - '
                                   || sqlcode
                                   || ' -ERROR- '
                                   || sqlerrm
             );
             
End Borrar_Libro;
        
END pkg_facturas_sat;

