  CREATE OR REPLACE EDITIONABLE PACKAGE BODY "LIBROCV02"."PKG_FECHAS" as
  
Function todate (fecha IN VARCHAR2) return date IS
   result Date;
BEGIN
     result := cast(to_timestamp_tz
                    (
                    fecha,
                    'YYYY-MM-DD"T"HH24:MI:SS.ff3 TZH:TZM'
                    ) as date);
     return result;
END todate;

Function toTimeStamp(fecha in Varchar2) 
    return TimeStamp is
   
    strFecha Varchar2(100);
    result TIMESTAMP;
begin
    strFecha := fecha;
     If instr(fecha,'-06:00') = 0 Then
        strfecha := strfecha||'-06:00';
     end if;   
      
     result := cast(to_timestamp_tz
                    (
                    fecha,
                    'YYYY-MM-DD"T"HH24:MI:SS.ff3 TZH:TZM'
                    ) as timestamp);
     return result;
      
     /*
      * En la salida de la funcion se puede poner el time zona para generar la hora equivalente 
      * pkg_fechas.toTimeStamp(fecha_emision)AT TIME ZONE 'Asia/Chita' -
      *
      */
      
end totimestamp;

Function toYear(Fecha in Date) return Number is
Begin
     Return to_number(to_char(Fecha,'YYYY'));
End;

Function toMonth(Fecha in Date) return Number is
Begin
     Return to_number(to_char(Fecha,'MM'));
End;


end pkg_fechas;

