  CREATE OR REPLACE EDITIONABLE PACKAGE BODY "LIBROCV02"."PKG_PROVEEDOR" AS

    PROCEDURE insertproveedores AS
    BEGIN
        INSERT /*+ ignore_row_on_dupkey_index ( proveedor ( nit ) ) */ INTO proveedor (
            nit,
            nombre_proveedor
        )
            SELECT
                nit,
                nombre_proveedor
            FROM
                tmp_proveedor t
            WHERE
                t.nombre_proveedor IS NOT NULL
                AND NOT EXISTS (
                    SELECT
                        1
                    FROM
                        proveedor p
                    WHERE
                        t.nit = p.nit
                );

    END insertproveedores;

END pkg_proveedor;

